const initialState = {
  name: "sangbin",
  age: 27,
  password: "babo",
};

const rootReducer = (state = initialState, action) => {
  switch (action.type) {
    case 'CHANGE_NICKNAME':
      return 
    default:
      return console.log("type check !");
  }
};

export default rootReducer;
